/* eslint-disable */
import React, { useEffect, useState } from 'react';
import { Button, Row, Col, Container } from 'reactstrap';
import axios from 'axios'

const SurveyGender = ({gender, setGender}) => {

    const moveNextPage = (e)=>{
        setGender(e.target.value)

        axios.get('http://localhost:8085/haru/')
        .then(res=>{
            console.log('통신성공');
        }).catch((e)=>{
            console.log('error',e);
        })
    }

    useEffect(()=>{
        console.log(gender);
    }, [gender])

    return (
        <div className="wrapper">
            <div className="middle-spacer" id="card-component">
                <Container>
                    <Row className="justify-content-center">
                        <Col md="7" className="text-center">
                            <h1 className="title font-bold">성별을 알려주세요.</h1>
                        </Col>
                    </Row>
                </Container>
            </div>
                <div id="gender-select">
                    <Button className="gender-btn" color="success" name="gender" value="man" onClick={moveNextPage}>남성</Button>
                    <Button className="gender-btn" color="success" name="gender" value="woman" onClick={moveNextPage}>여성</Button>
                </div>
        </div>
    );
}

export default SurveyGender;
